INSERT INTO config_info VALUES (1, 'xuxiaowei.yml', 'DEFAULT_GROUP', 'xuxiaowei:\n  cloud:\n    security:\n      private-key: \n      public-key: \n\nlogging:\n  level:\n    org.apache.coyote.http11.Http11InputBuffer: debug\n    org.springframework.cloud.gateway.handler.RoutePredicateHandlerMapping: debug\n    org.springframework.boot.autoconfigure.web.reactive.error.AbstractErrorWebExceptionHandler: debug\n    org.springframework.core.codec.CharSequenceEncoder: debug\n\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\nspringdoc:\n  swagger-ui:\n    default-models-expand-depth: 20\n    default-model-expand-depth: 20\n    oauth:\n      clientId: messaging-client\n      clientSecret: secret\n  oAuthFlow:\n    authorizationUrl: ${XUXIAOWEI_SPRINGDOC_OAUTHFLOW_AUTHORIZATION_URL:http://127.0.0.1:8000/passport/oauth2/authorize}\n    tokenUrl: ${XUXIAOWEI_SPRINGDOC_OAUTHFLOW_TOKEN_URL:http://127.0.0.1:8000/passport/oauth2/token}\n', '542cf5dfa9708f5aebcf6b341b2e20a0', '2024-03-03 15:00:39', '2024-03-06 03:38:14', 'nacos', '127.0.0.1', '', '', '', '', '', 'yaml', '', '');
INSERT INTO config_info VALUES (2, 'xuxiaowei-gateway.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n          lowerCaseServiceId: true\n      routes:\n        - id: passport\n          uri: lb://xuxiaowei-passport\n          predicates:\n            - Path=/passport/**\n          filters:\n            StripPrefix=1\n        - id: file\n          uri: lb://xuxiaowei-file\n          predicates:\n            - Path=/file/**\n          filters:\n            StripPrefix=1\n\n---\n\nspring:\n  cloud:\n    gateway:\n      globalcors:\n        corsConfigurations:\n          \'[/**]\':\n            allow-credentials: true\n            allowedOrigins:\n              - http://127.0.0.1:9000\n              - http://localhost:9000\n              - http://127.0.0.1:12000\n              - http://localhost:12000\n            allowedMethods: \"GET,POST\"\n            allowedHeaders: \"*\"\n\nspringdoc:\n  swagger-ui:\n    urls:\n      - name: passport\n        url: /passport/v3/api-docs\n      - name: file\n        url: /file/v3/api-docs\n', '7d21e742c2a603bde2ba9752c4db763d', '2024-03-03 15:22:10', '2024-03-06 03:53:04', 'nacos', '127.0.0.1', '', '', '', '', '', 'yaml', '', '');
